import React from "react";
import styled from "styled-components";
import Header from "../../components/SignUp/Header";
import SignUpCard from "../../components/SignUp/SignUpCard";


function SignUp() {
  return (
    <AppWrapper>
      <Header /> 
      <Divider />
      <MainContent>
        {/* <SignUpCard /> */}
        <SignUpCard />
        <ImageSection>
          <WildlifeImage loading="lazy" src="https://cdn.builder.io/api/v1/image/assets/TEMP/cce93baded15cf78beafdae5e82e359b245c19b27d59da6ad1ee73fc4f71def7?apiKey=e3765372b84f44f7af794f9207eac8b0&" alt="Wildlife" />
        </ImageSection>
      </MainContent>
    </AppWrapper>
  );
}

const AppWrapper = styled.div`
  border: 1px solid #a1a1a1;
  background-color: #fff;
  display: flex;
  flex-direction: column;
  padding: 0px 0 70px;
`;

const Divider = styled.hr`
  border: none;
  background-color: #c8cbd9;
  height: 1px;
  width: 100%;
`;

const MainContent = styled.main`
  display: flex;
  justify-content: center;
  margin-top: 10px;
  width: 100%;
  max-width: 1080px;
  @media (max-width: 991px) {
    flex-direction: column;
    align-items: stretch;
    margin-top: 40px;
  }
`;

const ImageSection = styled.aside`
  width: 44%;
  margin-left: 20px;
  @media (max-width: 991px) {
    width: 100%;
    margin-left: 0;
    margin-top: 40px;
  }
`;

const WildlifeImage = styled.img`
  aspect-ratio: 0.63;
  object-fit: cover;
  width: 100%;
`;

export default SignUp;
